import {React,useEffect,useState,useContext}from "react";
import axios from "axios";

import Footer from './Footer';
import SearchForm from './SearchForm';
import {useNavigate} from "react-router-dom";
import ProjectContext from "./ProjectContext";
const HomePage =()=>{
const [departureAirport,setDepartureAirport]=useState('');
const[airports,setAirports]=useState([]);
const[filteredAirports,setFilteredAirports]=useState([]);
const navigate=useNavigate();

const airportHandler=(e)=>{
    const {value}=e.target;
    setDepartureAirport(value);
    const filteredAirportsData=airports.filter((el)=>el.name.toLowerCaste().starsWith(e.target.value.toLowerCase()));
    console.log(filteredAirportsData);
    setFilteredAirports(filteredAirportsData);
};
useEffect(()=>{
    const getAirports= async()=>{
        const{data}=await axios.get("http://43.205.1.85:9009/vl/airports");
        setAirports(data.results);
    };
    getAirports();
},[]);
   const airportList=(airports)=>{
    return(
        <ul>
            {airports.map((airports) =>{
                return <li key={airports.id}>{airports.name}</li>;
            })}
        </ul>
    )
   };
   const onSubmitHandler=()=>{
    loginApi();
    navigate('/resuls?departureAirport=${departureAirport}');
   }
 const {user,setUser}=useContext(ProjectContext);
 
 const loginApi=()=>{
    setUser({
        user:'spoorthi achar',
        email:'spoorthichar9@gmail.com'
    })
 }
    return(
        <div id="app" className="generic">
        <div>
            <app-header>
                
            </app-header>
            <div className="content">
                <us-page-home inline-template>
                    <section id="home_page">
                        <div className="years-of-service">
                            <div className="container">
                                For 20 years, weâ€™ve helped travelers on their way. With free cancellations & a customer
                                service team in the US, we are committed to serving you.
                            </div>
                        </div>
                        <SearchForm />
                        <section id="benefits">
                            <div className="container">
                                <h5>What Can You Save with AirportParkingReservations.com?</h5>

                                <ul className="row">
                                    <li className="col-12 col-lg-4 p-3">
                                    <img src={require("./assets/check.png")} alt="Tick" width="50" height="50" />
                                        <div>
                                            <h6>Save Money</h6>
                                            <p>Save up to 70% off on our site compared to the cost of on-airport
                                                parking.</p>
                                        </div>
                                    </li>
                                    <li className="col-12 col-lg-4 p-3">
                                    <img src={require("./assets/check.png")} alt="Tick" width="50" height="50" />
                                        <div>
                                            <h6>Save Time</h6>
                                            <p>
                                                It's easy to compare parking at all major airports.<br />
                                                Booking a reservation is quick & simple!
                                            </p>
                                        </div>
                                    </li>
                                    <li className="col-12 col-lg-4 p-3">
                                    <img src={require("./assets/check.png")} alt="Tick" width="50" height="50" />
                                        <div>
                                            <h6>Save Stress</h6>
                                            <p>
                                                Guarantee your parking spot by booking in advance. Can't make it?
                                                Cancellations are free.
                                            </p>
                                        </div>
                                    </li>
                                </ul>
                            </div>
                        </section>

                    </section>
                </us-page-home>
            </div>
        </div>
    </div>
    )
}

export default HomePage;
